スターウォーズ - ミニバスト カーベ ＆ マフタック<br><table width="700" bgcolor="#000000"><tr><td align="right" bgcolor="#075255" width="152"><font size="2" color="#FFFFFF">メーカー：</font></td><td bgcolor="#073555" width="536"><font size="2" color="#FFFFFF">ジェントルジャイアント</font></td></tr><tr><td align="right" bgcolor="#075255" valign="top" width="152"><font size="2" color="#FFFFFF">サイズ：</font></td><td bgcolor="#073555" width="536"><font size="2" color="#FFFFFF">高さ約18cm、13cm</font></td></tr><tr><td align="right" bgcolor="#075255" width="152"><font size="2" color="#FFFFFF">パッケージ形態：</font></td><td bgcolor="#073555" width="536"><font size="2" color="#FFFFFF">ウィンドウボックス</font></td></tr><tr><td align="right" bgcolor="#075255" width="152"><font size="2" color="#FFFFFF">生産情報 ：</font></td><td bgcolor="#073555" width="536"><font size="2" color="#FFFFFF">初回限定生産</font></td></tr><tr><td align="right" bgcolor="#075255" width="184"><font size="2" color="#FFFFFF">JANコード：</font></td><td bgcolor="#073555" width="497"><font size="2" color="#FFFFFF">4580279601925</font></td></tr><tbody><tr valign="top" bgcolor="#E4FFEA"><td colspan="2" align="right"><div align="left"><font size="2">ジェントル・ジャイアントの定番であるミニバストシリーズに、『エピソード4/新たな希望』に登場したマフタックとカーベが2体セットでラインナップ。 <br><br>強い絆で結ばれているマフタックと相棒のカーベは、砂漠の惑星タトゥイーンにあるモス・アイズリーの酒場の常連客である。知能犯のチャドラ＝ファン種族のカーベは、特有の敏捷性と嗅覚を活かして盗みを働き、強大なタルズ種族のマフタックが絶えず外敵からカーベを守っていた。<br><br>全高が約18センチと約13センチの本アイテム。仲良しコンビが飲み物を片手に会話を楽しんでいるかのようだ。マフタックのけむくじゃらな体毛やネズミに似たカーベの容姿などをジェントル・ジャイアントが世界に誇る造形技術で見事に再現している。 <br><br>『スター・ウォーズ』の楽しい世界へと誘ってくれるコレクションになるのは間違いない！</font></div></td></tr></tbody></table><table width="700" border="0" cellspacing="1" cellpadding="10"><tr><td bgcolor="#000000"><center><img src="http://image.rakuten.co.jp/ustoy/cabinet/sw/genntle_giant/gg601925-1.jpg" alt="スターウォーズミニバスト"><br><br><font size="2" color="#9999FF"><b>※画像は試作品のため実際の商品と異なる場合がございます。<br><br></b></font></center></td></tr></table><style type="text/css">
#rakutenLimitedId_header{display:none;}
</style>

　アメリカンアリゲーター（ワニ）◎ビッグサイズフィギュア ソフトビニールモデル☆水生生物グッズ通販☆【RCP】(夏休み/自由研究/理科)◆<!-- ★お気に入り--><div class="w280-c"><div class="center-m-0a"><img class="item-oki-bn" alt="キャラクターグッズ通販シネマコレクションのお気に入りリストを確認する" src="http://image.rakuten.co.jp/cinemacollection/cabinet/oki-2.gif"></div></div><!-- ★お気に入りココまで--><!--★削除不可--></span></td></tr></table><br></td></tr></table><br><table cellpadding="0" border="0"><tr><td><table cellpadding="0" border="0"><tr><td><span><!--関連検索キーワード--><div style="width:100%;text-align: center"><h3 style="color:#7f7f7f;">フェバリット/水の生物/置物/玩具/柔らか/遊べる/通販</h3><img style="margin:15px 0 10px 0;width:100% ;border:none;" alt="キャラクターグッズ専門店/シネマコレクション/商品詳細" src="http://www.rakuten.ne.jp/gold/cinemacollection/bn/item-bn01.gif" /><div style="color:#7f7f7f;width:90%;margin:0 auto;#efefef solid 1px;padding:10px;text-align: left;">大迫力！！アメリカンアリゲーターを正確に再現したハイクオリティーフィギュア☆<br>柔らかなソフビ素材を使用しているので軽くて丈夫な触って遊べる☆<br>小さなお子様が触れても大丈夫なビニール素材を使用しているため、リビングや子ども部屋にも安心<br>本格的なディテールですのでインテリアとしてもおススメです。<br><br>■サイズ：約395×125×93mm</div></div><div style="width:100%;text-align: center;"><img style="margin:15px 0 10px 0;width:100% ;border:none;" alt="キャラクターグッズ専門店/シネマコレクション/詳細画像" src="http://www.rakuten.ne.jp/gold/cinemacollection/bn/item-bn02.gif" /><div style="width:100%;margin:0 auto;"><img style="width:260px;margin:2px;border:none;" src="http://image.rakuten.co.jp/cinemacollection/cabinet/r20130918/fvt-fa-306-a.jpg"><img style="width:260px;margin:2px;border:none;" src="http://image.rakuten.co.jp/cinemacollection/cabinet/r20130918/fvt-fa-306-a_2.jpg"><img style="width:260px;margin:2px;border:none;" src="http://image.rakuten.co.jp/cinemacollection/cabinet/r20130918/fvt-fa-306-a_3.jpg"><img style="width:260px;margin:2px;border:none;" src="http://image.rakuten.co.jp/cinemacollection/cabinet/r20130918/fvt-fa-306-a_4.jpg"><img style="width:260px;margin:2px;border:none;" src="http://image.rakuten.co.jp/cinemacollection/cabinet/r20130918/fvt-fa-306-a_5.jpg"></div></div><!--関連検索キーワード--><div class="kanren-link"